an good for ADULTS only. Kids under negotiation.</li></ul>\r\n                            ', '', '9200', '7360', '20', '2', '8224.8', '4113', '866', '0', 'HUT HOUSE', '2014-11-16', '2014-06-15', '2014-06-16', '2014-12-15', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '1840', '1', 'BPI', '002523013109', 'Unni Jose A. Macavinta', '2', 'BPI', '002524-0024-61', 'Balinghai Beach Resort', '3', '', '', '', '4', '', '', '', '5', '', '', '');
