Each room is prepared with air-conditioning for your comfort a mini fridge and a private bathroom with hot &amp; cold shower.</li><li><u style=\"font-weight: bold;\">Our Bungalows</u> - are suited at the back garden,&nbsp;<br>*a quieter area farther and away from the beachfront.<br>* each cottage is conveniently equipped with a shared kitchen (cottages are duplex style, 2 rooms each and every room w/ two wide double beds)<br>*note that all aoutfitted with Wireless Internet Connection 24/7<br>*located anywhere around the resort premises.</li><li>children 6 yrs old and below if sharing bed with parents are free of charge(1 child only per room)</li></ul></div>\r\n        ', 'Deparis_Boracay_Beach_Resort.pdf', '1960', '1568', '20', '1', '1752.24', '1753', '185', '0', 'ROOM FOR 1 PAX', '2013-12-16', '2014-01-02', '2014-01-27', '2014-02-09', '2014-04-11', '2014-04-21', '2014-10-30', '2014-11-01', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '392', '1', 'BPI', '002523890592', 'Melani A. Deparis', '2', '', '', '', '3', '', '', '', '4', '', '', '', '5', '', '', '');
