ur preformance</li></ul>\r\n        ', 'Alfonso_Hotel.pdf', '2575', '1900', '26.2135', '2', '2217.25', '1109', '317.998', '0', 'DELUXE', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '0000-00-00', '674.998', '1', '', '', '', '2', '', '', '', '3', '', '', '', '4', '', '', '', '5', '', '', '');
